import Item from './Item'

function MenuSection({ name, setOrder }) {

    return (
    <div>
        <h2>{name}</h2>
        <Item name={'Dough Balls'} price={4.99} setOrder={setOrder}/>
        <Item name={'Garlic Pizza Bread '} price={4.59} setOrder={setOrder}/>
        <Item name={'Garlic Pizza Bread with Mozzarella'} price={4.99} setOrder={setOrder}/>
        <Item name={'Garlic Bread with Vegan Mozzarella '} price={4.99} setOrder={setOrder}/>
    </div>
    ); 

  }

export default MenuSection;
